import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const attrIbutes = [
  {
    title: "title",
    author: "author",
    img: "https://m.media-amazon.com/images/I/61JSKZ6vHQS._AC_UY218_.jpg",
  },
];

let name = {
  item: {
    name: "aaa",
  },
};

console.log(name.item.name2 || "xx");

function BookList() {
  return (
    <section className="booklist">
      {attrIbutes.map((el, index) => (
        <Book key={index} {...el} />
      ))}
    </section>
  );
}

const namesList = [{ name: "Nume 1" }, { name: "Nume 2" }, { name: "Nume 3" }];

function List() {
  return namesList.map((item, index) => {
    return <p key={index}>{item.name}</p>;
  });
}

const Book = ({ img, title, author }) => {
  return (
    <article className="book">
      <img src={img} alt="yeah" />
      <h1>{title}</h1>
      <h4>{author}</h4>
      <p></p>
      <List />
    </article>
  );
};

ReactDom.render(<BookList />, document.getElementById("root"));

const ts = [7, -8, 2, 5, -12, -2, 10];

function computeClosestToZero(ts) {
  // Write your code here
  // To debug: console.error('Debug messages...');
  return ts.reduce((a, b) => {
    const closest = Math.abs(b) < Math.abs(a) ? b : a;
    return ts.includes(Math.abs(closest)) ? Math.abs(closest) : closest;
  });
}

console.log(computeClosestToZero(ts));
